Triples in RDF are made of a subject, a predicate and an object. They can be obtained respectively via the methods Triple::s , Triple::p and Triple::o , or all at once (as an array of three terms) via the method Triple::spo . These methods also have a to_X version that destructs the original triple instead of borrowing it. # use sophia::api::{ns::rdf, prelude::*};
// Example: yield all the terms being used as types in the given triples
fn all_types<IT, T>(triples: IT) -> impl Iterator<Item=T::Term>
where IT: IntoIterator<Item=T>, T: Triple,
{ triples .into_iter() .filter(|t| rdf::type_ == t.p()) .map(|t| t.to_o())
}

