Quads are used to represent triples in the context of an optional named graph . Like triples, they have methods Quad::s , Quad::p and Quad::o , but also Quad::g to access the optional graph name, and Quad::spog to obtain all four components all at once. These methods also have a to_X version that destructs the original quad instead of borrowing it. # use sophia::api::{ns::rdf, prelude::*};
// Example: yield all the triples in the default graph, from a list of quads
fn all_types<IQ, Q>(quads: IQ) -> impl Iterator<Item=[Q::Term; 3]>
where IQ: IntoIterator<Item=Q>, Q: Quad,
{ quads .into_iter() .filter(|q| q.g().is_none()) .map(|q| { let (spo, _g) = q.to_spog(); spo })
}

