RDF graphs are sets of triples, so the most common thing you need to do with a graph is to iterate over its triples. This is achieved with the Graph::triples method: # use sophia::api::prelude::*;
# use sophia::inmem::graph::LightGraph;
# fn main() -> Result<(), Box<dyn std::error::Error>> {
# let g = LightGraph::new();
for result in g.triples() { let triple = result?; // do something with t;
}
# Ok(()) } Notice that Graph::triples yields Result s, as some implementations of Graph may fail at any point of the iteration. When only a subset of the triples in the graph are of interest, you will want to use the Graph::triples_matching method: # use sophia::api::{ns::rdf, prelude::*, term::SimpleTerm};
# use sophia::inmem::graph::LightGraph; # let graph = LightGraph::new();
// Utility closure to recognize IRIs in the schema.org namespace
let in_schema_org = |t: SimpleTerm| -> bool { t.iri() .map(|iri| iri.as_str().starts_with(("http://schema.org/"))) .unwrap_or(false)
};
// Iter over all instances of schema.org types
graph .triples_matching(Any, [rdf::type_], in_schema_org) .map(|res| { let [s, _, o] = res.unwrap().to_spo(); (s, o)}) .for_each(|(instance, typ)| { // do something }) Graph::triples_matching accepts a large variety of parameters, which will be described in more detail in the next chapter . Graph also provide methods to iterate over all subjects , predicate and object in the graph, as well as over all unique terms of a certain kind ( Graph::iris , Graph::blank_nodes , Graph::literals , etc.). Finally, it is possible to check whether a graph contains a specific triple with the method Graph::contains .

