Any implementation of Graph that can be mutated should also implement MutableGraph , which comes with additional methods for modifying the graph. Individual triples can be added to the graph (resp. removed from the graph) with MutableGraph::insert (resp. MutableGraph::remove ). Inserting (resp. removing) a triple that is already (resp. not) present in the graph will be essentially a noop. # use sophia::{api::{ns::rdf, prelude::*}, iri::*};
/// Example: increment the rdf:value of a given subject
# fn f<G: MutableGraph>(mut g: G) -> Result<(), Box<dyn std::error::Error>> {
# let s = Iri::new_unchecked("https://example.org/foo");
let old_value: i32 = g.triples_matching([s], [rdf::value], Any) .next() .unwrap()? .o() .try_into_term()?;
g.remove(s, rdf::value, old_value)?;
g.insert(s, rdf::value, old_value + 1)?;
# Ok(()) } Batch modifications can also be performed on mutable graphs: MutableGraph::insert_all inserts all the triples from a triple source [1] ; MutableGraph::remove_all removes all the triples from a triple source [1] ; MutableGraph::remove_matching removes all the triples matching the parameters; MutableGraph::retain_matching removes all the triples except those matching the parameters. The parameters of remove_matching and retain_matching are similar to those of Graph::triples_matching and are described in more detail in the next chapter .

