Below is a short example demonstrating how to build a graph, mutate it and serialize it back. Add the sophia crate to your dependencies in Cargo.toml [dependencies]
sophia = "0.8.0" Add these lines of code and run the program. use sophia::api::prelude::*;
use sophia::api::ns::Namespace;
use sophia::inmem::graph::LightGraph;
use sophia::turtle::parser::turtle;
use sophia::turtle::serializer::nt::NtSerializer; // loading a graph
let example = r#" @prefix : <http://example.org/>. @prefix foaf: <http://xmlns.com/foaf/0.1/>. :alice foaf:name "Alice"; foaf:mbox <mailto:alice@work.example> . :bob foaf:name "Bob".
"#;
let mut graph: LightGraph = turtle::parse_str(example).collect_triples()?; // mutating the graph
let ex = Namespace::new("http://example.org/")?;
let foaf = Namespace::new("http://xmlns.com/foaf/0.1/")?;
graph.insert( ex.get("bob")?, foaf.get("knows")?, ex.get("alice")?,
)?; // serializing the graph
let mut nt_stringifier = NtSerializer::new_stringifier();
let example2 = nt_stringifier.serialize_graph(&graph)?.as_str();
println!("The resulting graph:\n{}", example2);
# Ok::<(), Box<dyn std::error::Error>>(()) You should get the following output: The resulting graph:
