The first thing you usually need to know about a term is its kind (IRI, Literal...). The kind is described by the TermKind enum, and available from the Term::kind method. # use sophia::api::term::{SimpleTerm, Term, TermKind};
# use TermKind::*;
# let some_term: SimpleTerm = "foo".into_term();
match some_term.kind() { Iri => { /* ... */ } Literal => { /* ... */ } BlankNode => { /* ... */ } _ => { /* ... */ }
} Alternatively, when only one kind is of interest, you can use Term::is_iri , Term::is_literal , Term::is_blank_node , etc. If you are interested in the "value" of the term, the trait provides the following methods. All of them return an Option, which will be None if the term does not have the corresponding kind. If the term is an IRI, Term::iri returns that IRI [1] . If the term is a blank node, Term::bnode_id returns its blank node identifier . If the term is a literal: Term::lexical_form returns its lexical form (the "textual value" of the literal), Term::datatype returns its datatype IRI [1] , Term::language_tag returns its language tag , if any. If the term is a quoted triple : Term::triple returns its 3 components in an array of terms, Term::constituents iterates over all its constituents , Term::atoms iterates over all its atomic (i.e. non quoted-triple) constituents. (those three methods also have a to_X version that destructs the original term instead of borrowing it) If the term is a variable [2] , Term::variable returns its name. Finally, the method Term::eq can be used to check whether two values implementing Term represent the same RDF term. Note that the == operator may give a different result than Term::eq on some types implementing the Term trait.
